webpackJsonp([63126745147860],{3988:function(e,a){e.exports={data:{markdownRemark:{html:'<h2>Docker</h2>\n<p><a href="https://www.docker.com/">Docker</a> is a widely-used container platform available for Linux, Windows, and Mac, as well as cloud providers like AWS and Azure.</p>\n<p>A common use case would be to package an app and all it’s requirements in a container. The container can then be used during development, passed to quality assurance/testing, and on to production/operations. This eliminates the “works on my machine” mentality, as the container effectively <em>is</em> the machine, no matter what actual hardware it may be running on.</p>\n<p><a href="https://hub.docker.com/explore/">Docker Store</a> contains many common applications packaged up into containers and ready to be used.</p>\n<h2>Further reading</h2>\n<ul>\n<li><a href="https://docs.docker.com">Docker Documentation</a></li>\n</ul>',fields:{slug:"/containers/docker/"},frontmatter:{title:"Docker"}}},pathContext:{slug:"/containers/docker/"}}}});
